import React, { useContext } from 'react';
import './Menu.css';
import MenuContext from "../MenuContext";

function Menu(){
    const [menuState, dispatch] = useContext(MenuContext);

    return (
        <div className="menu">
            <button onClick={() => dispatch({type: 'setItemState', payload: "start"})}>Start Item</button>
            <button onClick={() => dispatch({type: 'setItemState', payload: "wall"})}>Wall Item</button>
            <button onClick={() => dispatch({type: 'setItemState', payload: "end"})}>End Item</button>
            <button onClick={() => dispatch({type: 'clear'})}>Clear</button>
            <button onClick={() => dispatch({type: 'run'})}>Run</button>
        </div>
    )
}

export default Menu;
